import React from 'react';
import logo from './logo.svg';
import './App.css';
import stylesStars from "./styles/stars.module.scss";

function App() {
  return (
    <div>
      <h1>Hello worl !</h1>
      <section>
        <div className={styles.stars}>
          <div className={styles.stars__rear}></div>
          <div className={styles.stars__center}></div>
          <div className={styles.stars__front}></div>
        </div>
      </section>
    </div>
  );
}

export default App;
